import {Empty} from "antd"
import React from "react"
import {YakitEmptyProps} from "./YakitEmptyType"
import styles from "./YakitEmpty.module.scss"
import classNames from "classnames"
import Icon from "@ant-design/icons"
import {CustomIconComponentProps} from "@ant-design/icons/lib/components/Icon"

const EmptySvg = () => (
    <svg
        width='160'
        height='160'
        viewBox='0 0 160 160'
        fill='none'
        xmlns='http://www.w3.org/2000/svg'
        xmlnsXlink='http://www.w3.org/1999/xlink'
    >
        <rect width='160' height='160' fill='url(#pattern0)' />
        <defs>
            <pattern id='pattern0' patternContentUnits='objectBoundingBox' width='1' height='1'>
                <use xlinkHref='#image0_3342_124605' transform='scale(0.00174825)' />
            </pattern>
            <image
                id='image0_3342_124605'
                width='572'
                height='572'
                xlinkHref='data:image/png;base64,'
            />
        </defs>
    </svg>
)

/**
 * @description: empty 图片
 */
export const EmptySvgIcon = (props: Partial<CustomIconComponentProps>) => {
    return <Icon component={EmptySvg} {...props} />
}

/**
 * @description:YakitEmpty
 * @augments YakitEmptyProps 继承antd的 Empty 默认属性
 */
export const YakitEmpty: React.FC<YakitEmptyProps> = (props) => {
    return (
        <Empty
            image={<EmptySvgIcon />}
            imageStyle={
                props.imageStyle
                    ? props.imageStyle
                    : {
                          height: "auto",
                          marginBottom: 24
                      }
            }
            {...props}
            description={
                !props.descriptionReactNode && (
                    <div className={styles["yakit-empty"]}>
                        <div className={styles["yakit-empty-title"]}>{props.title || "暂无数据"}</div>
                        <div className={styles["yakit-empty-description"]}>{props.description}</div>
                    </div>
                )
            }
        >
            {props.children}
        </Empty>
    )
}
